import React from 'react';
import '../styles/HomePage.css'; // Si usas CSS modularizado

function HomePage() {
  return (
    <div className="homepage">
      <h2>Bienvenido a Mi Aplicación</h2>
      <p>Aquí puedes analizar palabras clave, revisar la competencia y mucho más.</p>
    </div>
  );
}

export default HomePage;
